  [],\n\t\"revision_timestamp\": \"2015-05-07T03:33:49.828424\",\n\t\"name\": \"aspirated-compressors-for-high-altitude-engines-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Aurora Flight Sciences proposes to incorporate
  aspirated compressor technology into a high altitude, long endurance (HALE) concept
  engine.  Aspiration has been proven to increase the stage loading of gas turbine
  compressors and fans, potentially allowing weight reduction through the reduction
  of compression stages or through the reduction of stresses through decreased spool
  speeds.  Additionally, aspiration has the potential to increase the low Reynolds
  number capability of an engine through improved control of the viscous boundary
  layer.  Low Re capability is important for the performance of high altitude engines
  operating in low density air, as well as of lower power, micro-scale engines. Although
  the component level benefits of aspiration have been experimentally verified and
  the design techniques established, the issues surrounding the integration of the
  technology in an engine system have yet to be adequately addressed.  The performance
  benefit of aspiration to an engine system will depend on the details of how bleed
  air from the compressor is utilized elsewhere in the engine cycle.  The maximum
  benefit of the technology will also depend on the net weight reduction achievable
  once all supporting subsystems are taken into account. Aurora proposes to investigate
  the interdependences between aspiration flow requirements, weight reduction, and
  overall cycle efficiency as part of an optimization effort to maximize the capability
  of a HALE engine.  The effort will define the benefits of compressor aspiration
  in a low Reynolds number environment and provide the rational for using the HALE
  mission as a launch application for this promising technology. \",\n\t\"license_title\":
